import  { Component } from "react";
import ButtonComponent from "./button-component";
import Option_component from "./Option_component";
import Search_component from "./Search_component";

class Filter extends Component {
  render() {
    return (
      <>
        <div className="c-filter">
          <div className="c-filter__left">
          <ButtonComponent isActive title={'Title đây'}  />

          </div>
          <div className="c-filter__right">
            <ul>c
              <li>
                <Search_component />
              </li>
              <li>
                <Option_component title="Lọc đánh giá" option1="Nhiều đánh giá" option2="Ít đánh giá"></Option_component>
              </li>
              <li>
              <Option_component title="Lọc theo" option1="Mới nhất" option2="Cũ"></Option_component>
              </li>
            </ul>
          </div>
        </div>
      </>
    );
  }
}

export default Filter;
